import s from './constantMenu.module.css';
import {Navlink} from "react-router-dom";

const CostantMenu = () =>{
  return (
    <div className={s.menu}>
      <div>Profile</div>
      <div>Film Catalog</div>
      <div>Book Catalog</div>
    </div>
  );
}

export default CostantMenu;
